<body style="font-family:'微软雅黑'; font-size:11pt; font-weight:400; font-style:normal;">
<p style="margin:0px;">费用和收入进行配比，配比之后出现的差额就是利润</p>
<p style="margin:0px;">利润：企业在一定会计期间内的经营成果，包括收入减去费用后的净额、直接计入当期利润的利得和损失</p>
<p style="-qt-paragraph-type:empty; margin:0px;"><br /></p>
<p style="margin:0px;">如果利润是正数，就意味着所有者权益增加；如果利润是负数，就意味着所有者权益减少</p>
<p style="-qt-paragraph-type:empty; margin:0px;"><br /></p>
<p style="margin:0px;">许多特点都体现在“收入”和“费用”这两个要素上</p>
<p style="margin:0px;">其金额是通过收入减去费用后的余额来确定的</p>
<p style="-qt-paragraph-type:empty; margin:0px;"><br /></p>
<p style="margin:0px;">利润也可以分为营业利润和利得、损失等。</p>
<p style="margin:0px;">利润总额 - 所得税费用 = 净利润</p>
<p style="-qt-paragraph-type:empty; margin:0px;"><br /></p>
<p style="margin:0px;">经济活动对所有者权益的影响</p>
